// components/MemberArea.js
import React from 'react';
import './MemberArea.css';

const MemberArea = () => {
  return (
    <section className="member-area">
      <h3>Member Area</h3>
      <p>Login to view your health summary and latest updates.</p>
      <button>Login</button>
    </section>
  );
};

export default MemberArea;
